    authDomain: "tall-tale-travel.firebaseapp.com",
    projectId: "tall-tale-travel",
    storageBucket: "tall-tale-travel.appspot.com",
    messagingSenderId: "286663599024",
    appId: "1:286663599024:web:d92f55ec2e107863eeac75"
};
